import { Sky } from '@react-three/drei'

export default function Firmament(props) {
  return (
    <Sky
      turbidity={4}
      distance={60} // Camera distance (default=450000)
      sunPosition={[100000, 6000, 300]} // Sun position normal (defaults to inclination and azimuth if not set)
      inclination={0.6} // Sun elevation angle from 0 to 1 (default=0)
      elevation={5.7}
      exposure={0.344}
      mieDirectionalG={0.096}
      azimuth={0.5} // Sun rotation around the Y axis from 0 to 1 (default=0.25)
      {...props} // All three/examples/jsm/objects/Sky props are valid
    />  )
}
